INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11531, NULL, 'Think about the ways that quitting smoking will improve your life and health. Make a list to remind yourself.
', 'SimpleMessage', 101, '2015-04-19 17:54:05.605350', '2015-09-16 07:49:21.693711', NULL, NULL, NULL, NULL, 1, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11532, NULL, 'Who can help you though tough times once you quit? Find family or friends who are willing to support you.
', 'SimpleMessage', 101, '2015-04-19 17:54:17.879278', '2015-09-16 07:49:21.764161', NULL, NULL, NULL, NULL, 2, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11533, NULL, 'Difficult situations will arise once you quit. Think about what situations will be hard for you and how you can plan to handle them.
', 'SimpleMessage', 101, '2015-04-19 17:54:30.577921', '2015-09-16 07:49:21.725178', NULL, NULL, NULL, NULL, 3, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11534, NULL, 'Ask yourself what you like about smoking. What other activities give you the same pleasures as smoking? Make a list.
', 'SimpleMessage', 101, '2015-04-19 17:54:41.998253', '2015-09-16 07:49:21.812937', NULL, NULL, NULL, NULL, 4, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11535, NULL, 'Reducing stress can make quitting easier. How can you reduce stress in your life?
', 'SimpleMessage', 101, '2015-04-19 17:54:54.185272', '2015-09-16 07:49:21.775303', NULL, NULL, NULL, NULL, 5, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11536, NULL, 'Plan enjoyable activities to do every day - now and after you quit!
', 'SimpleMessage', 101, '2015-04-19 17:55:05.999921', '2015-09-16 07:49:21.787871', NULL, NULL, NULL, NULL, 6, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11537, NULL, 'Being around other smokers once you quit is hard! Think about how you are going to handle those situations before they are a problem.
', 'SimpleMessage', 101, '2015-04-19 17:58:02.582829', '2015-09-16 07:49:21.802453', NULL, NULL, NULL, NULL, 7, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11538, NULL, 'Do you usually smoke while doing certain activities, like driving or having a drink? Try to skip smoking during one of these activities today.
', 'SimpleMessage', 101, '2015-04-19 17:58:15.597779', '2015-09-16 07:49:21.844581', NULL, NULL, NULL, NULL, 8, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11539, NULL, 'Tell supportive friends and family about your quit date. They can help encourage you once you do quit.
', 'SimpleMessage', 101, '2015-04-19 17:59:59.055288', '2015-09-16 07:49:21.737949', NULL, NULL, NULL, NULL, 9, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11540, NULL, 'Spend time thinking about the reasons why you want to quit and the benefits you will experience when you do quit.
', 'SimpleMessage', 101, '2015-04-19 18:01:07.640620', '2015-09-16 07:49:21.877634', NULL, NULL, NULL, NULL, 10, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11541, NULL, 'Remind yourself that you can choose to smoke or not. Make a promise to yourself to NOT smoke and stick with your quit date.
', 'SimpleMessage', 101, '2015-04-19 18:01:21.968500', '2015-09-16 07:49:21.889216', NULL, NULL, NULL, NULL, 11, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11542, NULL, 'Take the health hazards of smoking seriously! What health benefits of not smoking are most important to you? 
', 'SimpleMessage', 101, '2015-04-19 18:01:33.779120', '2015-09-16 07:49:21.903190', NULL, NULL, NULL, NULL, 12, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11543, NULL, 'Reward yourself when you don''t smoke one of your usual cigarettes...with something other than a cigarette!
', 'SimpleMessage', 101, '2015-04-19 18:01:43.616740', '2015-09-16 07:49:21.913897', NULL, NULL, NULL, NULL, 13, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11546, NULL, 'Notice how much the public supports non-smokers and YOU. Look at all the "no smoking" signs and non-smokers out there.
', 'SimpleMessage', 101, '2015-04-19 18:02:29.211441', '2015-09-16 07:49:24.694036', NULL, NULL, NULL, NULL, 18, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11547, NULL, 'Learn about healthier ways of dealing with stress, like being active or relaxing by doing an activity you enjoy.
', 'SimpleMessage', 101, '2015-04-19 18:02:46.374544', '2015-09-16 07:49:24.811525', NULL, NULL, NULL, NULL, 19, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11548, NULL, 'Replace things that remind you of smoking (like ashtrays) with something to remind you to NOT smoke (like a picture of loved ones).
', 'SimpleMessage', 101, '2015-04-19 18:02:58.132712', '2015-09-16 07:49:24.794298', NULL, NULL, NULL, NULL, 20, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11549, NULL, 'Have you thought about using medications to help you quit? They can really help with cravings, so think about trying one of them out. 
', 'SimpleMessage', 101, '2015-04-19 18:03:21.248486', '2015-09-16 07:49:24.705045', NULL, NULL, NULL, NULL, 21, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11550, NULL, 'If stress is a problem for you, consider taking a class or reading a book about relaxation or meditation. It can really help!
', 'SimpleMessage', 101, '2015-04-19 18:03:32.930243', '2015-09-16 07:49:24.773888', NULL, NULL, NULL, NULL, 22, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11551, NULL, 'What activities in your life make you want to smoke? Make a list and see if you can change your routine to avoid these situations.
', 'SimpleMessage', 101, '2015-04-19 18:03:45.792452', '2015-09-16 07:49:24.763147', NULL, NULL, NULL, NULL, 23, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11552, NULL, 'After you quit your body needs to adjust to not having nicotine. Know the symptoms of withdrawal and take it easy on yourself for a while.
', 'SimpleMessage', 101, '2015-04-19 18:03:58.252847', '2015-09-16 07:49:24.675603', NULL, NULL, NULL, NULL, 24, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11553, NULL, 'Do you have friends or family members who smoke? Tell them your plan to quit and ask for their support.
', 'SimpleMessage', 101, '2015-04-19 18:04:35.956675', '2015-09-16 07:49:24.750473', NULL, NULL, NULL, NULL, 25, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11554, NULL, 'Keep track of when you have cravings to smoke. If you know when you are tempted, you can better plan and avoid an urge.
', 'SimpleMessage', 101, '2015-04-19 18:05:40.832224', '2015-09-16 07:49:24.665632', NULL, NULL, NULL, NULL, 26, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11555, NULL, 'Your body begins to heal 20 minutes after your last cigarette. Learning about the instant health benefits of quitting can help motivate you.
', 'SimpleMessage', 101, '2015-04-19 18:06:07.658293', '2015-09-16 07:49:24.739703', NULL, NULL, NULL, NULL, 27, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11556, NULL, 'Cravings for cigarettes are usually the worst the first 2-3 days after quitting. What''s your plan for dealing with cravings?
', 'SimpleMessage', 101, '2015-04-19 18:06:18.632950', '2015-09-16 07:49:24.729115', NULL, NULL, NULL, NULL, 28, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11557, NULL, 'Get rid of temptations and reminders of smoking - throw out cigarettes and get rid of ashtrays at home, work, and in the car.
', 'SimpleMessage', 101, '2015-04-19 18:06:32.384164', '2015-09-16 07:49:24.717315', NULL, NULL, NULL, NULL, 29, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11564, NULL, 'You may miss having something in your hand after you quit. Try holding a pencil, paper clip, or water bottle instead of a cigarette.
', 'SimpleMessage', 102, '2015-04-19 18:08:23.082218', '2015-09-16 07:49:21.957273', NULL, NULL, NULL, NULL, 6, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11565, NULL, 'What situations were difficult for you last time you tried to quit? What can you do this time to make it easier on yourself?
', 'SimpleMessage', 102, '2015-04-19 18:08:36.018098', '2015-09-16 07:49:24.606417', NULL, NULL, NULL, NULL, 7, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11566, NULL, 'Set goals for things you can''t do now, but  want to after you quit, like run a race or save for a trip. Keep these goals in mind when you quit.
', 'SimpleMessage', 102, '2015-04-19 18:08:53.612567', '2015-09-16 07:49:22.150156', NULL, NULL, NULL, NULL, 8, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11567, NULL, 'Know the people, places, situations, and feelings that make you want to smoke. Write them down and keep the list in your wallet.
', 'SimpleMessage', 102, '2015-04-19 18:09:10.286210', '2015-09-16 07:49:21.972072', NULL, NULL, NULL, NULL, 9, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11569, NULL, 'Ask yourself: when I tried to quit before, what helped and what didn''t?
', 'SimpleMessage', 102, '2015-04-19 18:10:08.192251', '2015-09-16 07:49:22.159880', NULL, NULL, NULL, NULL, 11, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11571, NULL, 'Think you''ll miss having something to put in your mouth? Plan ahead by having toothpicks, cinnamon sticks, hard candy or gum on hand.
', 'SimpleMessage', 102, '2015-04-19 18:10:31.555085', '2015-09-16 07:49:24.570177', NULL, NULL, NULL, NULL, 13, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11572, NULL, 'Nicotine is a strong addiction and quitting is hard! Keep planning for success and you will succeed.
', 'SimpleMessage', 102, '2015-04-19 18:10:50.058240', '2015-09-16 07:49:21.992204', NULL, NULL, NULL, NULL, 14, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11574, NULL, 'Remember the nicotine withdrawal symptoms you had last time you quit? What made it easier for you to deal with these symptoms?
', 'SimpleMessage', 102, '2015-04-19 18:12:47.490637', '2015-09-16 07:49:20.867941', NULL, NULL, NULL, NULL, 17, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11575, NULL, 'Notice any physical benefits, like having an easier time walking up stairs or breathing, last time you quit? Remember these positive effects!
', 'SimpleMessage', 102, '2015-04-19 18:13:43.521097', '2015-09-16 07:49:18.080724', NULL, NULL, NULL, NULL, 18, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11576, NULL, 'What helped you survive cravings last time you quit? Plan to use the strategies that worked again and ditch the ones that didn''t help.
', 'SimpleMessage', 102, '2015-04-19 18:17:55.392666', '2015-09-16 07:49:24.653358', NULL, NULL, NULL, NULL, 20, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11578, NULL, 'Avoiding smoking areas - at work, home, or in public places - is one way to get yourself ready to quit.
', 'SimpleMessage', 102, '2015-04-19 18:18:32.436513', '2015-09-16 07:49:22.119691', NULL, NULL, NULL, NULL, 22, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11579, NULL, 'Telling other people about your quit date can help you stick with it.  
', 'SimpleMessage', 102, '2015-04-19 18:18:44.170835', '2015-09-16 07:49:20.841279', NULL, NULL, NULL, NULL, 23, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11580, NULL, 'Remind yourself of all the money you will save on cigarettes. What else could you do with this money?
', 'SimpleMessage', 102, '2015-04-19 18:19:53.776430', '2015-09-16 07:49:20.824112', NULL, NULL, NULL, NULL, 24, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11581, NULL, 'Notice when you usually smoke during the day. Changing your routine now can make it easier to quit when the day comes.
', 'SimpleMessage', 102, '2015-04-19 18:20:03.923842', '2015-09-16 07:49:20.791057', NULL, NULL, NULL, NULL, 25, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11582, NULL, 'In the first week or two after quitting you may have trouble sleeping. Cut out caffeine in the afternoons and take naps if you can.
', 'SimpleMessage', 102, '2015-04-19 18:20:14.580453', '2015-09-16 07:49:22.172052', NULL, NULL, NULL, NULL, 26, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11583, NULL, 'Think about the people, places, and things that made it difficult to quit before. Plan to avoid these as much as possible this time.
', 'SimpleMessage', 102, '2015-04-19 18:20:25.724423', '2015-09-16 07:49:22.182052', NULL, NULL, NULL, NULL, 27, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11584, NULL, 'Irritability and tiredness can last a few weeks after quitting. You will feel better once the nicotine has cleared out of your system.
', 'SimpleMessage', 102, '2015-04-19 18:20:35.219830', '2015-09-16 07:49:20.770949', NULL, NULL, NULL, NULL, 28, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11585, NULL, 'How are you going to deal with cravings the first few days after you quit? Those first few days are usually the worst, so have a plan.
', 'SimpleMessage', 102, '2015-04-19 18:20:46.241452', '2015-09-16 07:49:22.107531', NULL, NULL, NULL, NULL, 29, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11586, NULL, 'Each time you try to quit, the more likely you are to succeed. It''s great that you are going to give it another shot!
', 'SimpleMessage', 102, '2015-04-19 18:20:58.314405', '2015-09-16 07:49:22.070548', NULL, NULL, NULL, NULL, 30, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11600, NULL, 'Congratulations on your decision to quit!!  It''s like opening the door to freedom and walking through! 
', 'SimpleMessage', 104, '2015-04-19 18:32:51.064493', '2015-11-29 13:46:47.295795', NULL, NULL, NULL, NULL, 1, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 2 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11601, NULL, 'The first day of being quit is the hardest. Keep your focus on your goal, and you''ll make it happen!
', 'SimpleMessage', 104, '2015-04-19 18:34:53.681934', '2015-11-29 13:46:56.940587', NULL, NULL, NULL, NULL, 2, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 2 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11603, NULL, 'Make sure you have cleaned out your stashed cigarettes.  Even a stale cigarette looks good after a strong craving.', 'SimpleMessage', 104, '2015-04-19 18:39:48.521992', '2015-11-29 13:47:08.152307', NULL, NULL, NULL, NULL, 4, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 3 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11604, NULL, 'Think about all of the people who you can share your quitting process with and make plans to chat with them about your progress.

', 'SimpleMessage', 104, '2015-04-19 18:40:46.152308', '2015-11-29 13:47:18.565891', NULL, NULL, NULL, NULL, 5, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 3 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11605, NULL, 'Think of different places to go when you have a craving.  Just moving may be enough to get your mind off of the craving for a cigarette.
', 'SimpleMessage', 104, '2015-04-19 18:47:45.011809', '2015-11-29 13:48:02.529118', NULL, NULL, NULL, NULL, 6, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 4 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11606, NULL, 'The worst of nicotine withdrawal is over in a few weeks, but breaking the smoking habit comes more slowly.
', 'SimpleMessage', 104, '2015-04-19 18:49:58.192517', '2015-11-29 13:48:11.456641', NULL, NULL, NULL, NULL, 7, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 4 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11607, NULL, 'Picture the things in life that are important to you.  How does smoking NOT fit with this picture?
', 'SimpleMessage', 104, '2015-04-19 18:52:01.869428', '2015-11-29 13:48:24.817556', NULL, NULL, NULL, NULL, 8, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 5 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11608, NULL, 'Slips happen. Remind yourself why you quit in the first place and get back to it!
', 'SimpleMessage', 105, '2015-04-19 19:06:10.637894', '2015-09-16 07:49:22.212022', NULL, NULL, NULL, NULL, 1, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11609, NULL, 'You can still succeed at quitting smoking.  The key is to START RIGHT NOW, not tomorrow or next week.
', 'SimpleMessage', 105, '2015-04-19 19:08:13.861543', '2015-09-16 07:49:22.221934', NULL, NULL, NULL, NULL, 2, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11610, NULL, 'A single cigarette - or even 3 - while quitting, isn''t the end of the world. But it makes it harder to stay quit.   
', 'SimpleMessage', 105, '2015-04-19 19:08:44.310514', '2015-09-16 07:49:24.617712', NULL, NULL, NULL, NULL, 3, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11611, NULL, 'Imagine you have an allergy to cigarettes and you''d get itchy with hives and sneezing if you smoke.  
', 'SimpleMessage', 105, '2015-04-19 19:09:18.844651', '2015-09-16 07:49:22.235596', NULL, NULL, NULL, NULL, 4, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11612, NULL, 'Take a few deep breaths.  A slip is just a slip - not a downfall.  You can get back on track right away
', 'SimpleMessage', 105, '2015-04-19 19:09:39.752341', '2015-09-16 07:49:22.041939', NULL, NULL, NULL, NULL, 5, NULL, 't', '', 1, '', 30, 1, NULL, NULL, NULL, 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11613, NULL, 'Getting free of cigarettes is an up and down process - it doesn''t go in a simple straight line.  Take your time and start again
