INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11750, NULL, 'Taking a few slow, deep breaths can help you better cope with stress and manage cravings. Give it a try!
', 'SimpleMessage', 104, '2015-04-20 19:29:18.033652', '2015-11-29 14:02:05.429135', NULL, NULL, NULL, NULL, 91, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 36 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11751, NULL, 'Take time out to talk with someone else who has quit smoking, you may find some new strategies to help you in your quitting.
