INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11753, NULL, 'Obstacles are those annoying things you see when you take your eyes off your goals!
', 'SimpleMessage', 104, '2015-04-20 19:30:03.848131', '2015-11-29 14:02:28.076843', NULL, NULL, NULL, NULL, 94, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 37 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11754, NULL, 'Certain activities may boost your urge to smoke. Alcohol is one of the most common triggers, so try to drink less when you first quit. 
', 'SimpleMessage', 104, '2015-04-20 19:30:13.802814', '2015-11-29 14:02:38.988435', NULL, NULL, NULL, NULL, 95, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 37 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11757, NULL, 'If you usually smoked after meals, find something else to do instead, like brushing your teeth or chewing gum.
', 'SimpleMessage', 104, '2015-04-20 19:31:09.223748', '2015-11-29 14:02:52.177662', NULL, NULL, NULL, NULL, 98, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 38 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11758, NULL, 'When you want to reach for a cigarette, put on your inline skates or jogging shoes instead. ', 'SimpleMessage', 104, '2015-04-20 19:31:20.276724', '2015-11-29 14:03:02.396229', NULL, NULL, NULL, NULL, 99, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 38 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11761, NULL, 'The mental addiction to cigarettes can be even stronger than the physical addiction! Be prepared.
', 'SimpleMessage', 104, '2015-04-20 19:32:07.870609', '2015-11-29 14:03:16.218802', NULL, NULL, NULL, NULL, 102, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 39 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11762, NULL, 'Mild exercise is helpful, such as walking the dog or pulling weeds in the garden. The extra calories you burn will also ward off weight gain.
', 'SimpleMessage', 104, '2015-04-20 19:32:16.921808', '2015-11-29 14:03:28.581318', NULL, NULL, NULL, NULL, 103, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 39 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11763, NULL, 'Text or call a buddy when you have a craving or think about having a cigarette.  Work out ways to deal with it without giving in. 
