INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11765, NULL, 'Smoking triggers can come out of the blue and create urges that make you feel like you''re right back in the midst of the physical addiction.
', 'SimpleMessage', 104, '2015-04-20 19:32:46.698077', '2015-11-29 14:04:04.261318', NULL, NULL, NULL, NULL, 106, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 41 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11766, NULL, 'Dont try to diet while giving up cigarettes  too much deprivation is bound to backfire. Instead, focus on eating more fruits and  vegetables. 
