INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11768, NULL, 'Be sure to reward yourself for reaching your short and long-term goals.  Make sure it''s something fun! 
