', 'SimpleMessage', 107, '2015-04-21 11:38:14.402967', '2015-11-29 14:21:21.732633', NULL, NULL, NULL, NULL, 96, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 37 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11877, NULL, 'Certain activities may boost your urge to smoke. Alcohol is one of the most common triggers, so try to drink less when you first quit. 
', 'SimpleMessage', 107, '2015-04-21 11:38:34.208075', '2015-11-29 14:21:30.552719', NULL, NULL, NULL, NULL, 97, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 37 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11880, NULL, 'If you usually smoked after meals, find something else to do instead, like brushing your teeth or chewing gum.
', 'SimpleMessage', 107, '2015-04-21 11:39:15.127978', '2015-11-29 14:21:40.505393', NULL, NULL, NULL, NULL, 100, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 38 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11881, NULL, 'When you want to reach for a cigarette, put on your inline skates or jogging shoes instead. ', 'SimpleMessage', 107, '2015-04-21 11:39:31.349417', '2015-11-29 14:21:50.666306', NULL, NULL, NULL, NULL, 101, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 38 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11884, NULL, 'The mental addiction to cigarettes can be even stronger than the physical addiction! Be prepared.
', 'SimpleMessage', 107, '2015-04-21 11:40:25.785915', '2015-11-29 14:22:03.327978', NULL, NULL, NULL, NULL, 104, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 39 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11885, NULL, 'Mild exercise is helpful, such as walking the dog or pulling weeds in the garden. The extra calories you burn will also ward off weight gain.
', 'SimpleMessage', 107, '2015-04-21 11:40:49.529945', '2015-11-29 14:22:13.908008', NULL, NULL, NULL, NULL, 105, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 39 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11886, NULL, 'Text or call a buddy when you have a craving or think about having a cigarette.  Work out ways to deal with it without giving in. 
', 'SimpleMessage', 107, '2015-04-21 11:41:18.676227', '2015-11-29 14:22:25.931096', NULL, NULL, NULL, NULL, 106, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 40 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11887, NULL, 'Quitting smoking is not the most important thing. What''s important is that you believe in yourself, and keep reaching for your goals
', 'SimpleMessage', 107, '2015-04-21 11:41:36.998813', '2015-11-29 14:22:37.795916', NULL, NULL, NULL, NULL, 107, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 40 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11888, NULL, 'Smoking triggers can come out of the blue and create urges that make you feel like you''re right back in the midst of the physical addiction.
', 'SimpleMessage', 107, '2015-04-21 11:41:53.557474', '2015-11-29 14:22:47.948461', NULL, NULL, NULL, NULL, 108, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 41 9:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11889, NULL, 'Dont try to diet while giving up cigarettes  too much deprivation is bound to backfire. Instead, focus on eating more fruits and  vegetables. 
', 'SimpleMessage', 107, '2015-04-21 11:42:09.092758', '2015-11-29 14:22:58.168270', NULL, NULL, NULL, NULL, 109, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 41 16:30', 't', 'f', NULL)
INSERT INTO "messages" ("id", "title", "caption", "type", "channel_id", "created_at", "updated_at", "content_file_name", "content_content_type", "content_file_size", "content_updated_at", "seq_no", "next_send_time", "primary", "reminder_message_text", "reminder_delay", "repeat_reminder_message_text", "repeat_reminder_delay", "number_of_repeat_reminders", "options", "deleted_at", "schedule", "active", "requires_response", "recurring_schedule") VALUES (11891, NULL, 'Be sure to reward yourself for reaching your short and long-term goals.  Make sure it''s something fun! 
', 'SimpleMessage', 107, '2015-04-21 11:42:42.929704', '2015-11-29 14:23:09.152897', NULL, NULL, NULL, NULL, 111, NULL, 't', '', 1, '', 30, 1, NULL, NULL, 'Day 42 9:30', 't', 'f', NULL)
