INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1, 11082, 'strong', 'You are a strong person and you can make a big difference. ', '2015-03-11 17:30:53.861430', '2015-03-11 17:30:53.861430')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (2, 11082, 'happy', 'You are a happy person, and can make a big difference with your smile.', '2015-03-11 17:30:53.867504', '2015-03-11 17:30:53.867504')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (3, 11082, 'simple', 'You are a person that makes things simple.', '2015-03-11 17:30:53.874461', '2015-03-11 17:30:53.874461')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (4, 11083, 'strong', 'You make people more confident with your strong actions.', '2015-03-11 17:31:54.169930', '2015-03-11 17:31:54.169930')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (5, 11083, 'happy', 'You make people happy with your smile.', '2015-03-11 17:31:54.172998', '2015-03-11 17:31:54.172998')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (6, 11083, 'simple', 'You are a person that simplifies other''s lives.', '2015-03-11 17:31:54.175339', '2015-03-11 17:31:54.175339')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (173, 12734, 'Perseverance', 'You work hard to finish what you start. No matter the project, you "get it out the door" in a timely fashion. You do not get distracted when you work, and you take satisfaction in completing tasks.', '2015-07-23 19:18:58.913570', '2015-08-24 18:31:11.816736')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (174, 12734, 'Perseverance ', 'Know your strengths: You work hard to finish anything you start. How has perseverance played out in your life this week?', '2015-07-23 19:18:58.924065', '2015-08-24 18:31:11.820565')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (182, 12734, 'Teamwork', 'You excel as a member of a group. You are a loyal and dedicated teammate, you always do your share, and you work hard for the success of your group', '2015-08-24 18:31:11.553273', '2015-08-24 18:31:11.553273')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (183, 12734, 'Teamwork', 'Know your strengths: You work very well in a team. Consider how you have demonstrated teamwork this week and how that has helped others.', '2015-08-24 18:31:11.651884', '2015-08-24 18:31:11.651884')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (184, 12734, 'Teamwork', 'Know your strengths: You are a dedicated and hardworking team player. How has your loyalty and commitment to working with others played out this week?', '2015-08-24 18:31:11.655397', '2015-08-24 18:31:11.655397')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (185, 12734, 'Hope ', 'You expect the best in the future, and you work to achieve it. You believe that the future is something that you can control.', '2015-08-24 18:31:11.658779', '2015-08-24 18:31:11.658779')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (186, 12734, 'Hope', 'Know your strengths: You believe that you can control your future. Consider how your belief in yourself and abilities worked for you this week.', '2015-08-24 18:31:11.661728', '2015-08-24 18:31:11.661728')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (187, 12734, 'Hope', 'Know your strengths: You expect the best in the future and work hard to achieve your goals. How has your optimism about the future played out this week?', '2015-08-24 18:31:11.666343', '2015-08-24 18:31:11.666343')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (188, 12734, 'Humor', 'You like to laugh and tease. Bringing smiles to other people is important to you. You try to see the light side of all situations.', '2015-08-24 18:31:11.670808', '2015-08-24 18:31:11.670808')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (189, 12734, 'Humor', 'Know your strengths: You are someone who likes to bring smiles to other people. How have you made yourself and others smile this week?', '2015-08-24 18:31:11.674014', '2015-08-24 18:31:11.674014')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (190, 12734, 'Humor', 'Know your strengths: You try to see the light side of any situation. Consider how you have used laughter to make a situation better this week.', '2015-08-24 18:31:11.677095', '2015-08-24 18:31:11.677095')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (191, 12734, 'Kindness', 'You are kind and generous to others, and you are never too busy to do a favor. You enjoy doing good deeds for others, even if you do not know them well.', '2015-08-24 18:31:11.681057', '2015-08-24 18:31:11.681057')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (192, 12734, 'Kindness', 'Know your strengths: You are kind and generous to everyone who crosses your path. Consider how your generosity towards others played out this week.', '2015-08-24 18:31:11.686271', '2015-08-24 18:31:11.686271')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (193, 12734, 'Kindness', 'Know your strengths: You are someone who enjoys doing good deeds for others no matter how busy you are. How has your kindness towards other worked for you this week? ', '2015-08-24 18:31:11.689016', '2015-08-24 18:31:11.689016')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (194, 12734, 'Spirituality', 'Know your strengths: Your spirituality shapes your actions and are a source of comfort. How has your spirituality provided comfort to you this week?', '2015-08-24 18:31:11.691691', '2015-08-24 18:31:11.691691')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (195, 12734, 'Spirituality', 'Know your strengths: You have a strong belief in the higher purpose. Consider how your spirituality has played out this week.', '2015-08-24 18:31:11.694340', '2015-08-24 18:31:11.694340')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (196, 12734, 'Spirituality ', 'You have strong and coherent beliefs about the higher purpose and meaning of the universe. You know where you fit in the larger scheme. Your beliefs shape your actions and are a source of comfort to you.', '2015-08-24 18:31:11.697309', '2015-08-24 18:31:11.697309')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (197, 12734, 'Zest', 'Regardless of what you do, you approach it with excitement and energy. You never do anything halfway or halfheartedly. For you, life is an adventure.', '2015-08-24 18:31:11.700043', '2015-08-24 18:31:11.700043')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (198, 12734, 'Zest', 'Know your strengths: You approach everything you do with excitement and energy. Consider how your zest for life has played out this week.', '2015-08-24 18:31:11.702656', '2015-08-24 18:31:11.702656')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (199, 12734, 'Zest', 'Know your strengths: Life is always an adventure, and you always give everything your all. How has your love for adventure worked for you this week?', '2015-08-24 18:31:11.706036', '2015-08-24 18:31:11.706036')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (200, 12734, 'Appreciation of Beauty & Excellence', 'You notice and appreciate beauty, excellence, and/or skilled performance in all domains of life, from nature to art to mathematics to science to everyday experience.', '2015-08-24 18:31:11.709090', '2015-08-24 18:31:11.709090')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (201, 12734, 'Appreciation of Beauty & Excellence', 'Know your strengths: You stop and take notice of the beauty in every day experiences. How has your ability to find beauty in life worked out for you this week?', '2015-08-24 18:31:11.711739', '2015-08-24 18:31:11.711739')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (202, 12734, 'Appreciation of Beauty & Excellence', 'Know your strengths: You appreciate excellence in many different areas of life. Consider how your appreciation for excellence has played out this week.', '2015-08-24 18:31:11.714374', '2015-08-24 18:31:11.714374')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (374, 12734, 'Leadership', 'Know your strengths: You excel at organizing group activities. Consider how your leadership has made something get done this week.', '2015-08-24 18:59:02.463968', '2015-08-24 18:59:02.463968')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (203, 12734, 'Bravery', 'You are a courageous person who does not shrink from threat, challenge, difficulty, or pain. You speak up for what is right even if there is opposition. You act on your convictions.', '2015-08-24 18:31:11.716957', '2015-08-24 18:31:11.716957')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (204, 12734, 'Bravery', 'Know your strengths: You dont shy away from a challenge. Consider how bravery has played out this week.', '2015-08-24 18:31:11.719510', '2015-08-24 18:31:11.719510')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (205, 12734, 'Bravery', 'Know your strengths: You speak up for what is right even when others dont agree. How has your courage to act on your convictions played out this week?', '2015-08-24 18:31:11.725535', '2015-08-24 18:31:11.725535')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (206, 12734, 'Creativity', 'Thinking of new ways to do things is a crucial part of who you are. You are never content with doing something the conventional way if a better way is possible.', '2015-08-24 18:31:11.728246', '2015-08-24 18:31:11.728246')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (207, 12734, 'Creativity', 'Know your strengths: You are never content with doing something the conventional way if there is a better way possible. How has ingenuity played out this week?', '2015-08-24 18:31:11.735503', '2015-08-24 18:31:11.735503')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (208, 12734, 'Creativity ', 'Know your strengths: Thinking of new and creative ways of doing things is a crucial part of who you are. Consider how your creativity has worked for you this week.', '2015-08-24 18:31:11.742181', '2015-08-24 18:31:11.742181')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (209, 12734, 'Fairness', 'Treating all people fairly is one of your abiding principles. You do not let your personal feelings bias your decisions about other people. You give everyone a chance.', '2015-08-24 18:31:11.744898', '2015-08-24 18:31:11.744898')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (210, 12734, 'Fairness', 'Know your strengths: You never let your personal feelings bias your decisions about other people. How has fairness played out this week?', '2015-08-24 18:31:11.748249', '2015-08-24 18:31:11.748249')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (211, 12734, 'Fairness ', 'Know your strengths: You always give everyone a chance. Consider how your strong sense of treating all people fairly has worked out for you and others this week?', '2015-08-24 18:31:11.755026', '2015-08-24 18:31:11.755026')
