INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1444, 13540, 'Perseverance', 'You always finish what you start. What will you gain by quitting smoking?  Make a list.  How will it feel to accomplish these goals?', '2015-09-22 15:18:10.170738', '2015-09-22 15:18:10.170738')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1445, 13540, 'Teamwork', 'Consider how your quitting smoking contributes to making a better world.', '2015-09-22 15:18:10.179533', '2015-09-22 15:18:10.179533')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1446, 13540, 'Hope', 'Difficult situations will arise once you quit. Think about what situations will be hard for you. Write them down and create plans for how you can handle them.', '2015-09-22 15:18:10.187682', '2015-09-22 15:18:10.187682')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1447, 13540, 'Humor', 'Make at least one person smile each day - now and after you quit!', '2015-09-22 15:18:10.196631', '2015-09-22 15:18:10.196631')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1448, 13540, 'Kindness', 'Picture the people in life that are important to you. Quitting smoking is an act of kindness not only to yourself but to others.', '2015-09-22 15:18:10.207028', '2015-09-22 15:18:10.207028')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1449, 13540, 'Spirituality', 'Difficult situations can arise while quitting smoking. Your strong sense of spirituality can serve as an important source of comfort.', '2015-09-22 15:18:10.215886', '2015-09-22 15:18:10.215886')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1451, 13540, 'Appreciation', 'Certain situations can be stressful when you quit smoking. Make a list of unfamiliar places you can visit that can remind you of all of the beauty in life.', '2015-09-22 15:18:10.232611', '2015-09-22 15:18:10.232611')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1452, 13540, 'Bravery', 'If you are doubting your ability to quit smoking, remind yourself of other challenges you have faced successfully.  Why should quitting smoking be any different?', '2015-09-22 15:18:10.241228', '2015-09-22 15:18:10.241228')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1453, 13540, 'Creativity', 'Plan at least 2 activities during the first week of quitting that allow you to be creative like painting, gardening, writing, or another hobby.', '2015-09-22 15:18:10.250231', '2015-09-22 15:18:10.250231')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1454, 13540, 'Fairness', 'Take time to think about how quitting smoking is good not just for you and your health but also for others around you and for those who care most for you.', '2015-09-22 15:18:10.259530', '2015-09-22 15:18:10.259530')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1455, 13540, 'Judgment', 'If you are wavering on your ability to quit smoking, consider all of the evidence that proves you can do it!', '2015-09-22 15:18:10.267645', '2015-09-22 15:18:10.267645')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1456, 13540, 'Perspective', 'If you are wavering on your decision to quit smoking, think of the wisest person you know. Write down what they would say to you to stay committed.', '2015-09-22 15:18:10.275513', '2015-09-22 15:18:10.275513')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1457, 13540, 'Learning', 'Attend a lecture at a local college or school about health-related risks of smoking.', '2015-09-22 15:18:10.283507', '2015-09-22 15:18:10.283507')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1458, 13540, 'Humility', 'Acknowledge that quitting is difficult and dont let yourself believe that this is something you can do with willpower alone. Reach out to others for support!', '2015-09-22 15:18:10.291620', '2015-09-22 15:18:10.291620')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1459, 13540, 'Intelligence', 'Some situations may cause stress when you first quit smoking. Make a list of what you can do in these different situations to mitigate the stress for yourself and others.', '2015-09-22 15:18:10.301694', '2015-09-22 15:18:10.301694')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1460, 13540, 'Prudence', 'You never say or do things you later regret. There is no reason to think your choice to quit smoking is different. You know youve made the right decision!', '2015-09-22 15:18:10.310205', '2015-09-22 15:18:10.310205')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1461, 13540, 'Curiosity', 'Talk to someone who has successfully quit smoking, and learn everything you can about what worked for him or her.', '2015-09-22 15:18:10.319909', '2015-09-22 15:18:10.319909')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1462, 13540, 'Honesty', 'Youve chosen to quit smoking. Now ask yourself how this aligns with your values.  Then, remind yourself that being a non-smoker is consistent with your values.', '2015-09-22 15:18:10.328741', '2015-09-22 15:18:10.328741')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1463, 13540, 'Leadership', 'Are there people in your life who may have a difficult time with your decision to quit? Think of ways to make them understand and feel part of your success.', '2015-09-22 15:18:10.337449', '2015-09-22 15:18:10.337449')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1464, 13540, 'Love', 'Remind yourself of the friends and loved ones who are happy about your decision to quit smoking.', '2015-09-22 15:18:10.346046', '2015-09-22 15:18:10.346046')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1465, 13540, 'Forgiveness', 'If you find yourself getting irritated with others who comment on your decision to quit, remember that they are trying to be helpful. Let go of your irritation.', '2015-09-22 15:18:10.354586', '2015-09-22 15:18:10.354586')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1466, 13540, 'Gratitude', 'Make a list of what you will be grateful for as a non-smoker and remind yourself of these during difficult times when its hard to stay on track.', '2015-09-22 15:18:10.363647', '2015-09-22 15:18:10.363647')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1467, 13540, 'Self-Regulation', 'You are an incredibly disciplined person and are in control of your thoughts, feelings, and actions. Quitting smoking is no different. You can do this!', '2015-09-22 15:18:10.372357', '2015-09-22 15:18:10.372357')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1468, 13541, 'Perseverance', 'You are someone who achieves what you set out to do. There is no reason to think quitting smoking will be different. You can do this!', '2015-09-22 15:18:10.594380', '2015-09-22 15:18:10.594380')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1469, 13541, 'Teamwork', 'Work with a buddy who also wants to quit: We are a team, and if you help me, I can help you', '2015-09-22 15:18:10.602710', '2015-09-22 15:18:10.602710')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1470, 13541, 'Hope', 'Picture a future for yourself in which you are a non-smoker.  What will this future look like?  How will you feel?', '2015-09-22 15:18:10.612682', '2015-09-22 15:18:10.612682')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1471, 13541, 'Humor', 'Use your humor to get other people to help you in your quit attempt.', '2015-09-22 15:18:10.624158', '2015-09-22 15:18:10.624158')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1472, 13541, 'Kindness', 'Be kind to yourself as you quit smoking.  Dont forget to reward yourself for this great accomplishment!  Use the money youve saved to treat yourself.', '2015-09-22 15:18:10.632550', '2015-09-22 15:18:10.632550')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1473, 13541, 'Spirituality', 'Remind yourself of your sense of purpose in life, and how becoming a non-smoker is compatible with this sense of purpose.', '2015-09-22 15:18:10.640696', '2015-09-22 15:18:10.640696')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1474, 13541, 'Zest', 'Make quitting smoking part of a bigger plan to be healthier and happier.', '2015-09-22 15:18:10.651359', '2015-09-22 15:18:10.651359')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1475, 13541, 'Appreciation', 'During your first week of quitting plan to do at least 2 activities that allow you to notice and appreciate beauty, like going to the park, a sporting event, or a concert.', '2015-09-22 15:18:10.660153', '2015-09-22 15:18:10.660153')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1476, 13541, 'Bravery', 'Quitting smoking can be a challenge. Remind yourself that you are someone who can do difficult things.', '2015-09-22 15:18:10.668604', '2015-09-22 15:18:10.668604')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1477, 13541, 'Creativity', 'Creativity comes naturally to you, and you dont do something the conventional way when there is a better way. Use this creativity in your quit attempt!', '2015-09-22 15:18:10.677632', '2015-09-22 15:18:10.677632')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1478, 13541, 'Fairness', 'Instead of giving yourself reasons why you cant quit smoking, think about all of the reasons that you deserve a chance just as you would for other people.', '2015-09-22 15:18:10.685643', '2015-09-22 15:18:10.685643')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1479, 13541, 'Judgment', 'Just as you do with everything else, treat quitting smoking with an open mind.', '2015-09-22 15:18:10.693660', '2015-09-22 15:18:10.693660')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1480, 13541, 'Perspective', 'Others value you and your perspective on life. Take time to think about how quitting smoking can be inspiring to others.', '2015-09-22 15:18:10.701714', '2015-09-22 15:18:10.701714')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1481, 13541, 'Learning', 'Read about all the benefits of quitting smoking.', '2015-09-22 15:18:10.711082', '2015-09-22 15:18:10.711082')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1482, 13541, 'Humility', 'Realize when you will be challenged to smoke and make sure you have taken steps to make you more likely to succeed.', '2015-09-22 15:18:10.719658', '2015-09-22 15:18:10.719658')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1483, 13541, 'Intelligence', 'Take notice of how others respond to your decision to quit smoking.  Who is happy for you? Who might not like the change? How can you put unsupportive people at ease?', '2015-09-22 15:18:10.727900', '2015-09-22 15:18:10.727900')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1484, 13541, 'Prudence', 'Your decision to quit smoking may be challenged, but you have carefully considered all of your options in making this decision. You can do this!', '2015-09-22 15:18:10.736582', '2015-09-22 15:18:10.736582')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1485, 13541, 'Curiosity', 'Learn as much as you can about the benefits of quitting smoking.', '2015-09-22 15:18:10.744859', '2015-09-22 15:18:10.744859')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1486, 13541, 'Honesty', 'Be honest with others. Tell people in your life that you have decided to quit smoking.', '2015-09-22 15:18:10.753390', '2015-09-22 15:18:10.753390')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1487, 13541, 'Leadership', 'Organize a social get-together for your friends that is incompatible with smoking (e.g., a smoke-free restaurant; a hike).', '2015-09-22 15:18:10.761648', '2015-09-22 15:18:10.761648')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1488, 13541, 'Love', 'Talk to your friends and loved ones about how much you care about them, and how much their support means to you as you become a non-smoker.', '2015-09-22 15:18:10.778700', '2015-09-22 15:18:10.778700')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1489, 13541, 'Forgiveness', 'Dont dwell on the past. You may have failed in past attempts to quit. Forgive yourself and realize that this is a new chance to protect your health.', '2015-09-22 15:18:10.787676', '2015-09-22 15:18:10.787676')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1490, 13541, 'Gratitude', 'Express gratitude to someone you cherish, and then ask for support in your quit attempt. Gaining support may be easier once youve expressed your gratitude.', '2015-09-22 15:18:10.798086', '2015-09-22 15:18:10.798086')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1491, 13541, 'Self-Regulation', 'It can be helpful to find a replacement when you quit smoking. Start a new hobby, such as an exercise program, and stick with it every day for a week.', '2015-09-22 15:18:10.806318', '2015-09-22 15:18:10.806318')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1492, 13542, 'Perseverance', 'You always finish what you start. What will you gain by quitting smoking?  Make a list.  How will it feel to accomplish these goals?', '2015-09-22 15:18:11.018087', '2015-09-22 15:18:11.018087')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1493, 13542, 'Teamwork', 'Consider how your quitting smoking contributes to making a better world.', '2015-09-22 15:18:11.026432', '2015-09-22 15:18:11.026432')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1494, 13542, 'Hope', 'Difficult situations will arise once you quit. Think about what situations will be hard for you. Write them down and create plans for how you can handle them.', '2015-09-22 15:18:11.034565', '2015-09-22 15:18:11.034565')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1495, 13542, 'Humor', 'Make at least one person smile each day - now and after you quit!', '2015-09-22 15:18:11.042541', '2015-09-22 15:18:11.042541')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1496, 13542, 'Kindness', 'Picture the people in life that are important to you. Quitting smoking is an act of kindness not only to yourself but to others.', '2015-09-22 15:18:11.050654', '2015-09-22 15:18:11.050654')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1497, 13542, 'Spirituality', 'Difficult situations can arise while quitting smoking. Your strong sense of spirituality can serve as an important source of comfort.', '2015-09-22 15:18:11.058762', '2015-09-22 15:18:11.058762')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1498, 13542, 'Zest', 'Find new activities where you can have fun and be engaged without smoking.', '2015-09-22 15:18:11.066764', '2015-09-22 15:18:11.066764')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1499, 13542, 'Appreciation', 'Certain situations can be stressful when you quit smoking. Make a list of unfamiliar places you can visit that can remind you of all of the beauty in life.', '2015-09-22 15:18:11.075824', '2015-09-22 15:18:11.075824')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1500, 13542, 'Bravery', 'If you are doubting your ability to quit smoking, remind yourself of other challenges you have faced successfully.  Why should quitting smoking be any different?', '2015-09-22 15:18:11.084081', '2015-09-22 15:18:11.084081')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1501, 13542, 'Creativity', 'Plan at least 2 activities during the first week of quitting that allow you to be creative like painting, gardening, writing, or another hobby.', '2015-09-22 15:18:11.092353', '2015-09-22 15:18:11.092353')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1502, 13542, 'Fairness', 'Take time to think about how quitting smoking is good not just for you and your health but also for others around you and for those who care most for you.', '2015-09-22 15:18:11.100688', '2015-09-22 15:18:11.100688')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1503, 13542, 'Judgment', 'If you are wavering on your ability to quit smoking, consider all of the evidence that proves you can do it!', '2015-09-22 15:18:11.108958', '2015-09-22 15:18:11.108958')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1504, 13542, 'Perspective', 'If you are wavering on your decision to quit smoking, think of the wisest person you know. Write down what they would say to you to stay committed.', '2015-09-22 15:18:11.117296', '2015-09-22 15:18:11.117296')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1505, 13542, 'Learning', 'Attend a lecture at a local college or school about health-related risks of smoking.', '2015-09-22 15:18:11.125919', '2015-09-22 15:18:11.125919')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1506, 13542, 'Humility', 'Acknowledge that quitting is difficult and dont let yourself believe that this is something you can do with willpower alone. Reach out to others for support!', '2015-09-22 15:18:11.134284', '2015-09-22 15:18:11.134284')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1507, 13542, 'Intelligence', 'Some situations may cause stress when you first quit smoking. Make a list of what you can do in these different situations to mitigate the stress for yourself and others.', '2015-09-22 15:18:11.142532', '2015-09-22 15:18:11.142532')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1508, 13542, 'Prudence', 'You never say or do things you later regret. There is no reason to think your choice to quit smoking is different. You know youve made the right decision!', '2015-09-22 15:18:11.151836', '2015-09-22 15:18:11.151836')
