INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1517, 13543, 'Teamwork', 'Work with a buddy who also wants to quit: We are a team, and if you help me, I can help you', '2015-09-22 15:18:11.467377', '2015-09-22 15:18:11.467377')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1518, 13543, 'Hope', 'Picture a future for yourself in which you are a non-smoker.  What will this future look like?  How will you feel?', '2015-09-22 15:18:11.475984', '2015-09-22 15:18:11.475984')
