INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1520, 13543, 'Kindness', 'Be kind to yourself as you quit smoking.  Dont forget to reward yourself for this great accomplishment!  Use the money youve saved to treat yourself.', '2015-09-22 15:18:11.492686', '2015-09-22 15:18:11.492686')
