INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1535, 13543, 'Leadership', 'Organize a social get-together for your friends that is incompatible with smoking (e.g., a smoke-free restaurant; a hike).', '2015-09-22 15:18:11.625897', '2015-09-22 15:18:11.625897')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1536, 13543, 'Love', 'Talk to your friends and loved ones about how much you care about them, and how much their support means to you as you become a non-smoker.', '2015-09-22 15:18:11.634683', '2015-09-22 15:18:11.634683')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1537, 13543, 'Forgiveness', 'Dont dwell on the past. You may have failed in past attempts to quit. Forgive yourself and realize that this is a new chance to protect your health.', '2015-09-22 15:18:11.642765', '2015-09-22 15:18:11.642765')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1538, 13543, 'Gratitude', 'Express gratitude to someone you cherish, and then ask for support in your quit attempt. Gaining support may be easier once youve expressed your gratitude.', '2015-09-22 15:18:11.651090', '2015-09-22 15:18:11.651090')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1539, 13543, 'Self-Regulation', 'It can be helpful to find a replacement when you quit smoking. Start a new hobby, such as an exercise program, and stick with it every day for a week.', '2015-09-22 15:18:11.659361', '2015-09-22 15:18:11.659361')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1540, 13544, 'Perseverance', 'You always finish what you start. What will you gain by quitting smoking?  Make a list.  How will it feel to accomplish these goals?', '2015-09-22 15:18:11.874277', '2015-09-22 15:18:11.874277')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1541, 13544, 'Teamwork', 'Consider how your quitting smoking contributes to making a better world.', '2015-09-22 15:18:11.882574', '2015-09-22 15:18:11.882574')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1542, 13544, 'Hope', 'Difficult situations will arise once you quit. Think about what situations will be hard for you. Write them down and create plans for how you can handle them.', '2015-09-22 15:18:11.890612', '2015-09-22 15:18:11.890612')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1543, 13544, 'Humor', 'Make at least one person smile each day - now and after you quit!', '2015-09-22 15:18:11.907946', '2015-09-22 15:18:11.907946')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1544, 13544, 'Kindness', 'Picture the people in life that are important to you. Quitting smoking is an act of kindness not only to yourself but to others.', '2015-09-22 15:18:11.916059', '2015-09-22 15:18:11.916059')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1545, 13544, 'Spirituality', 'Difficult situations can arise while quitting smoking. Your strong sense of spirituality can serve as an important source of comfort.', '2015-09-22 15:18:11.924099', '2015-09-22 15:18:11.924099')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1546, 13544, 'Zest', 'Find new activities where you can have fun and be engaged without smoking.', '2015-09-22 15:18:11.932664', '2015-09-22 15:18:11.932664')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1547, 13544, 'Appreciation', 'Certain situations can be stressful when you quit smoking. Make a list of unfamiliar places you can visit that can remind you of all of the beauty in life.', '2015-09-22 15:18:11.940585', '2015-09-22 15:18:11.940585')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1548, 13544, 'Bravery', 'If you are doubting your ability to quit smoking, remind yourself of other challenges you have faced successfully.  Why should quitting smoking be any different?', '2015-09-22 15:18:11.951295', '2015-09-22 15:18:11.951295')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1549, 13544, 'Creativity', 'Plan at least 2 activities during the first week of quitting that allow you to be creative like painting, gardening, writing, or another hobby.', '2015-09-22 15:18:11.960595', '2015-09-22 15:18:11.960595')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1550, 13544, 'Fairness', 'Take time to think about how quitting smoking is good not just for you and your health but also for others around you and for those who care most for you.', '2015-09-22 15:18:11.968834', '2015-09-22 15:18:11.968834')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1551, 13544, 'Judgment', 'If you are wavering on your ability to quit smoking, consider all of the evidence that proves you can do it!', '2015-09-22 15:18:11.977931', '2015-09-22 15:18:11.977931')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1552, 13544, 'Perspective', 'If you are wavering on your decision to quit smoking, think of the wisest person you know. Write down what they would say to you to stay committed.', '2015-09-22 15:18:11.985904', '2015-09-22 15:18:11.985904')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1553, 13544, 'Learning', 'Attend a lecture at a local college or school about health-related risks of smoking.', '2015-09-22 15:18:11.994008', '2015-09-22 15:18:11.994008')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1554, 13544, 'Humility', 'Acknowledge that quitting is difficult and dont let yourself believe that this is something you can do with willpower alone. Reach out to others for support!', '2015-09-22 15:18:12.002468', '2015-09-22 15:18:12.002468')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1555, 13544, 'Intelligence', 'Some situations may cause stress when you first quit smoking. Make a list of what you can do in these different situations to mitigate the stress for yourself and others.', '2015-09-22 15:18:12.010756', '2015-09-22 15:18:12.010756')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1556, 13544, 'Prudence', 'You never say or do things you later regret. There is no reason to think your choice to quit smoking is different. You know youve made the right decision!', '2015-09-22 15:18:12.020327', '2015-09-22 15:18:12.020327')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1557, 13544, 'Curiosity', 'Talk to someone who has successfully quit smoking, and learn everything you can about what worked for him or her.', '2015-09-22 15:18:12.028701', '2015-09-22 15:18:12.028701')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1558, 13544, 'Honesty', 'Youve chosen to quit smoking. Now ask yourself how this aligns with your values.  Then, remind yourself that being a non-smoker is consistent with your values.', '2015-09-22 15:18:12.037758', '2015-09-22 15:18:12.037758')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1559, 13544, 'Leadership', 'Are there people in your life who may have a difficult time with your decision to quit? Think of ways to make them understand and feel part of your success.', '2015-09-22 15:18:12.047341', '2015-09-22 15:18:12.047341')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1560, 13544, 'Love', 'Remind yourself of the friends and loved ones who are happy about your decision to quit smoking.', '2015-09-22 15:18:12.055544', '2015-09-22 15:18:12.055544')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1561, 13544, 'Forgiveness', 'If you find yourself getting irritated with others who comment on your decision to quit, remember that they are trying to be helpful. Let go of your irritation.', '2015-09-22 15:18:12.064330', '2015-09-22 15:18:12.064330')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1562, 13544, 'Gratitude', 'Make a list of what you will be grateful for as a non-smoker and remind yourself of these during difficult times when its hard to stay on track.', '2015-09-22 15:18:12.079529', '2015-09-22 15:18:12.079529')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1563, 13544, 'Self-Regulation', 'You are an incredibly disciplined person and are in control of your thoughts, feelings, and actions. Quitting smoking is no different. You can do this!', '2015-09-22 15:18:12.094882', '2015-09-22 15:18:12.094882')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1564, 13545, 'Perseverance', 'You are someone who achieves what you set out to do. There is no reason to think quitting smoking will be different. You can do this!', '2015-09-22 15:18:12.346926', '2015-09-22 15:18:12.346926')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1565, 13545, 'Teamwork', 'Work with a buddy who also wants to quit: We are a team, and if you help me, I can help you', '2015-09-22 15:18:12.358648', '2015-09-22 15:18:12.358648')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1566, 13545, 'Hope', 'Picture a future for yourself in which you are a non-smoker.  What will this future look like?  How will you feel?', '2015-09-22 15:18:12.382624', '2015-09-22 15:18:12.382624')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1567, 13545, 'Humor', 'Use your humor to get other people to help you in your quit attempt.', '2015-09-22 15:18:12.394056', '2015-09-22 15:18:12.394056')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1568, 13545, 'Kindness', 'Be kind to yourself as you quit smoking.  Dont forget to reward yourself for this great accomplishment!  Use the money youve saved to treat yourself.', '2015-09-22 15:18:12.405509', '2015-09-22 15:18:12.405509')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1569, 13545, 'Spirituality', 'Remind yourself of your sense of purpose in life, and how becoming a non-smoker is compatible with this sense of purpose.', '2015-09-22 15:18:12.415733', '2015-09-22 15:18:12.415733')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1570, 13545, 'Zest', 'Make quitting smoking part of a bigger plan to be healthier and happier.', '2015-09-22 15:18:12.430471', '2015-09-22 15:18:12.430471')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1571, 13545, 'Appreciation', 'During your first week of quitting plan to do at least 2 activities that allow you to notice and appreciate beauty, like going to the park, a sporting event, or a concert.', '2015-09-22 15:18:12.440519', '2015-09-22 15:18:12.440519')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1572, 13545, 'Bravery', 'Quitting smoking can be a challenge. Remind yourself that you are someone who can do difficult things.', '2015-09-22 15:18:12.452424', '2015-09-22 15:18:12.452424')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1573, 13545, 'Creativity', 'Creativity comes naturally to you, and you dont do something the conventional way when there is a better way. Use this creativity in your quit attempt!', '2015-09-22 15:18:12.466472', '2015-09-22 15:18:12.466472')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1574, 13545, 'Fairness', 'Instead of giving yourself reasons why you cant quit smoking, think about all of the reasons that you deserve a chance just as you would for other people.', '2015-09-22 15:18:12.476918', '2015-09-22 15:18:12.476918')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1575, 13545, 'Judgment', 'Just as you do with everything else, treat quitting smoking with an open mind.', '2015-09-22 15:18:12.487441', '2015-09-22 15:18:12.487441')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1576, 13545, 'Perspective', 'Others value you and your perspective on life. Take time to think about how quitting smoking can be inspiring to others.', '2015-09-22 15:18:12.500298', '2015-09-22 15:18:12.500298')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1577, 13545, 'Learning', 'Read about all the benefits of quitting smoking.', '2015-09-22 15:18:12.508594', '2015-09-22 15:18:12.508594')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1578, 13545, 'Humility', 'Realize when you will be challenged to smoke and make sure you have taken steps to make you more likely to succeed.', '2015-09-22 15:18:12.516722', '2015-09-22 15:18:12.516722')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1579, 13545, 'Intelligence', 'Take notice of how others respond to your decision to quit smoking.  Who is happy for you? Who might not like the change? How can you put unsupportive people at ease?', '2015-09-22 15:18:12.526094', '2015-09-22 15:18:12.526094')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1580, 13545, 'Prudence', 'Your decision to quit smoking may be challenged, but you have carefully considered all of your options in making this decision. You can do this!', '2015-09-22 15:18:12.534373', '2015-09-22 15:18:12.534373')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1581, 13545, 'Curiosity', 'Learn as much as you can about the benefits of quitting smoking.', '2015-09-22 15:18:12.542993', '2015-09-22 15:18:12.542993')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1582, 13545, 'Honesty', 'Be honest with others. Tell people in your life that you have decided to quit smoking.', '2015-09-22 15:18:12.552076', '2015-09-22 15:18:12.552076')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1583, 13545, 'Leadership', 'Organize a social get-together for your friends that is incompatible with smoking (e.g., a smoke-free restaurant; a hike).', '2015-09-22 15:18:12.562021', '2015-09-22 15:18:12.562021')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1584, 13545, 'Love', 'Talk to your friends and loved ones about how much you care about them, and how much their support means to you as you become a non-smoker.', '2015-09-22 15:18:12.570939', '2015-09-22 15:18:12.570939')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1585, 13545, 'Forgiveness', 'Dont dwell on the past. You may have failed in past attempts to quit. Forgive yourself and realize that this is a new chance to protect your health.', '2015-09-22 15:18:12.579243', '2015-09-22 15:18:12.579243')
