INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1610, 13546, 'Gratitude', 'Make a list of what you will be grateful for as a non-smoker and remind yourself of these during difficult times when its hard to stay on track.', '2015-09-22 15:18:13.076975', '2015-09-22 15:18:13.076975')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1611, 13546, 'Self-Regulation', 'You are an incredibly disciplined person and are in control of your thoughts, feelings, and actions. Quitting smoking is no different. You can do this!', '2015-09-22 15:18:13.084985', '2015-09-22 15:18:13.084985')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1612, 13547, 'Perseverance', 'You work hard to finish what you start, no matter what.  Remind yourself of this if you feel your commitment to remaining a non-smoker waiver.', '2015-09-22 15:18:35.300635', '2015-09-22 15:18:35.300635')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1613, 13547, 'Teamwork', 'Use the money you save through quitting to help others (e.g., donate half of the money you would have spent on cigarettes to a charity).', '2015-09-22 15:18:35.314410', '2015-09-22 15:18:35.314410')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1614, 13547, 'Hope', 'Believe in yourself and your ability to remain a non-smoker.', '2015-09-22 15:18:35.325744', '2015-09-22 15:18:35.325744')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1615, 13547, 'Humor', 'Look in the mirror and laugh at yourself when you have an urge to smoke.', '2015-09-22 15:18:35.337737', '2015-09-22 15:18:35.337737')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1702, 13550, 'Honesty', 'Remind yourself of the commitment you made to yourself to quit smoking.', '2015-09-22 15:18:37.153309', '2015-09-22 15:18:37.153309')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1616, 13547, 'Kindness', 'Do something kind for someone in your life who is helping you to remain a non-smoker. Treat them to a nice meal, buy them flowers, or write them a thoughtful card.', '2015-09-22 15:18:35.347070', '2015-09-22 15:18:35.347070')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1617, 13547, 'Spirituality', 'When tempted to smoke, ask a higher power for help.', '2015-09-22 15:18:35.356179', '2015-09-22 15:18:35.356179')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1618, 13547, 'Zest', 'Instead of smoking, go for a walk or do a physically active chore like gardening.', '2015-09-22 15:18:35.367518', '2015-09-22 15:18:35.367518')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1619, 13547, 'Appreciation', 'Appreciating beauty is something you do naturally. Taking time to appreciate beauty around you each day can lift your mood and take your mind off smoking.', '2015-09-22 15:18:35.378424', '2015-09-22 15:18:35.378424')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1620, 13547, 'Bravery', 'What is the strongest urge to smoke you have ever had?  Tell yourself that if you can get through that, you can get through any urge to smoke.', '2015-09-22 15:18:35.388987', '2015-09-22 15:18:35.388987')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1621, 13547, 'Creativity', 'Try to think of an unconventional way to manage your urges to smoke.', '2015-09-22 15:18:35.399465', '2015-09-22 15:18:35.399465')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1622, 13547, 'Fairness', 'Treat quitting smoking with an open mind.  Learn to see and accept both the challenges and the benefits of quitting.', '2015-09-22 15:18:35.414020', '2015-09-22 15:18:35.414020')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1623, 13547, 'Judgment', 'Use critical thinking to evaluate why its so important to quit smoking.  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:35.422558', '2015-09-22 15:18:35.422558')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1624, 13547, 'Perspective', 'Think about the wisdom of quitting smoking: Why is this a wise decision?  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:35.431341', '2015-09-22 15:18:35.431341')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1625, 13547, 'Learning', 'Share what you learn about the benefits of quitting smoking with someone else. This will allow you to savor what you have learned.', '2015-09-22 15:18:35.444294', '2015-09-22 15:18:35.444294')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1626, 13547, 'Humility', 'Even after you have quit for a few weeks, remind yourself that slips can still happen.', '2015-09-22 15:18:35.457265', '2015-09-22 15:18:35.457265')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1627, 13547, 'Intelligence', 'Be aware of your feelings, both good and bad, while quitting.  Share those feelings with someone you trust rather than trying to change them by smoking.', '2015-09-22 15:18:35.466180', '2015-09-22 15:18:35.466180')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1628, 13547, 'Prudence', 'Before you smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:35.475477', '2015-09-22 15:18:35.475477')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1629, 13547, 'Curiosity', 'Try to discover something new about yourself and your abilities as you become a non-smoker.', '2015-09-22 15:18:35.484880', '2015-09-22 15:18:35.484880')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1630, 13547, 'Honesty', 'Be honest with yourself about your efforts to quit smoking.  Get rid of all emergency or hidden cigarettes.', '2015-09-22 15:18:35.493027', '2015-09-22 15:18:35.493027')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1631, 13547, 'Leadership', 'If you feel an urge to reach for a cigarette, plan a fun group activity to distract yourself. The urge will subside!', '2015-09-22 15:18:35.503604', '2015-09-22 15:18:35.503604')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1632, 13547, 'Love', 'Congratulate and love yourself and your ability to quit smoking each day.', '2015-09-22 15:18:35.515585', '2015-09-22 15:18:35.515585')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1633, 13547, 'Forgiveness', 'Forgive yourself if you slip so that you can move on with a fresh start.  Remember: The most important thing you can do going forward is not light up again!', '2015-09-22 15:18:35.527468', '2015-09-22 15:18:35.527468')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1634, 13547, 'Gratitude', 'Notice and thank the people in your life who are helpful in your quit attempt.', '2015-09-22 15:18:35.539812', '2015-09-22 15:18:35.539812')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1635, 13547, 'Self-Regulation', 'If you get tempted to smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:35.551536', '2015-09-22 15:18:35.551536')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1636, 13548, 'Perseverance', 'Dont forget to take satisfaction in accomplishing your goal to be a non-smoker. Take stock of the amount of time youve been a non-smoker and celebrate.', '2015-09-22 15:18:35.865915', '2015-09-22 15:18:35.865915')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1637, 13548, 'Teamwork', 'You have worked hard to quit smoking. Who can you enlist to be part of your team to remain a non-smoker?', '2015-09-22 15:18:35.883830', '2015-09-22 15:18:35.883830')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1638, 13548, 'Hope', 'Reflect on what you hope to gain now that you are a non-smoker.', '2015-09-22 15:18:35.895021', '2015-09-22 15:18:35.895021')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1639, 13548, 'Humor', 'Use humor to try to get friends who smoke not to smoke around you.', '2015-09-22 15:18:35.904501', '2015-09-22 15:18:35.904501')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1640, 13548, 'Kindness', 'Performing an anonymous favor for someone to distract you from a craving can help the craving pass more quickly. Use your kindness instead of reaching for a cigarette!', '2015-09-22 15:18:35.915362', '2015-09-22 15:18:35.915362')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1641, 13548, 'Spirituality', 'Engage in meditation exercises to help reduce your stress and maintain your sense of purpose and spirituality. This will help control your urges to smoke.', '2015-09-22 15:18:35.940007', '2015-09-22 15:18:35.940007')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1642, 13548, 'Zest', 'Take time to celebrate being a non-smoker at least twice a week.', '2015-09-22 15:18:35.955733', '2015-09-22 15:18:35.955733')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1643, 13548, 'Appreciation', 'When you feel an urge to smoke, refocus your attention on something beautiful. Take a trip to a museum or take a long walk and notice the beauty in nature.', '2015-09-22 15:18:35.969484', '2015-09-22 15:18:35.969484')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1644, 13548, 'Bravery', 'Text or call a buddy when you have a craving or think about having a cigarette.  Draw on courage to deal with it without giving in. You can do it!', '2015-09-22 15:18:35.979706', '2015-09-22 15:18:35.979706')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1645, 13548, 'Creativity', 'Share the creative ways you are managing your quit attempt with friends and family members.  Perhaps the tools you generate will inspire someone else!', '2015-09-22 15:18:35.996038', '2015-09-22 15:18:35.996038')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1646, 13548, 'Fairness', 'If you are feeling irritable after quitting, realize that it is not anyones fault and that these feelings will pass.', '2015-09-22 15:18:36.006835', '2015-09-22 15:18:36.006835')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1647, 13548, 'Judgment', 'If you feel an urge to pick up a cigarette, play the devils advocate and list all of the reasons quitting is important for your health.', '2015-09-22 15:18:36.015665', '2015-09-22 15:18:36.015665')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1648, 13548, 'Perspective', 'If you are feeling an urge to smoke, reach out to a friend or loved one and tell them all the positive reasons why you have chosen to quit smoking.', '2015-09-22 15:18:36.024128', '2015-09-22 15:18:36.024128')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1649, 13548, 'Learning', 'Try to discover new ways that you feel (physically, mentally, emotionally) now that you are a non-smoker.', '2015-09-22 15:18:36.032773', '2015-09-22 15:18:36.032773')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1650, 13548, 'Humility', 'Dont be afraid to ask others for help during your quit attempt.', '2015-09-22 15:18:36.043776', '2015-09-22 15:18:36.043776')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1651, 13548, 'Intelligence', 'Focus on helping to make someone else feel at ease rather than focusing on your urges to smoke.', '2015-09-22 15:18:36.052390', '2015-09-22 15:18:36.052390')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1652, 13548, 'Prudence', 'When tempted to smoke, tell yourself: Not for the next 5 minutes.  Then stretch out this time period until it becomes hours, then days, then several weeks, etc.', '2015-09-22 15:18:36.061842', '2015-09-22 15:18:36.061842')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1653, 13548, 'Curiosity', 'Make a list of all of the new things you can do now that you are a non-smoker. Remind yourself of these if you get tempted to pick up a cigarette.', '2015-09-22 15:18:36.071328', '2015-09-22 15:18:36.071328')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1654, 13548, 'Honesty', 'Remind yourself of the commitment you made to yourself to quit smoking.', '2015-09-22 15:18:36.079926', '2015-09-22 15:18:36.079926')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1655, 13548, 'Leadership', 'See whether you can motivate others interest in quitting smoking with your own process of quitting.  Share tips you find helpful about the PPT program.', '2015-09-22 15:18:36.088555', '2015-09-22 15:18:36.088555')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1656, 13548, 'Love', 'Enjoy an evening with friends or loved ones that is incompatible with smoking (e.g., a smoke-free restaurant; a hike).', '2015-09-22 15:18:36.096790', '2015-09-22 15:18:36.096790')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1657, 13548, 'Forgiveness', 'Forgive others who may smoke around you and make your quit attempt harder.  Take the high road and simply exit the situation.', '2015-09-22 15:18:36.105572', '2015-09-22 15:18:36.105572')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1658, 13548, 'Gratitude', 'Make a list of the things in your life you are grateful for now that you are a non-smoker.', '2015-09-22 15:18:36.114122', '2015-09-22 15:18:36.114122')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1746, 13552, 'Humility', 'Dont be afraid to ask others for help during your quit attempt.', '2015-09-22 15:18:38.280389', '2015-09-22 15:18:38.280389')
