INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1685, 13550, 'Teamwork', 'You have worked hard to quit smoking. Who can you enlist to be part of your team to remain a non-smoker?', '2015-09-22 15:18:36.944716', '2015-09-22 15:18:36.944716')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1686, 13550, 'Hope', 'Reflect on what you hope to gain now that you are a non-smoker.', '2015-09-22 15:18:36.954482', '2015-09-22 15:18:36.954482')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1687, 13550, 'Humor', 'Use humor to try to get friends who smoke not to smoke around you.', '2015-09-22 15:18:36.970065', '2015-09-22 15:18:36.970065')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1688, 13550, 'Kindness', 'Performing an anonymous favor for someone to distract you from a craving can help the craving pass more quickly. Use your kindness instead of reaching for a cigarette!', '2015-09-22 15:18:36.979357', '2015-09-22 15:18:36.979357')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1689, 13550, 'Spirituality', 'Engage in meditation exercises to help reduce your stress and maintain your sense of purpose and spirituality. This will help control your urges to smoke.', '2015-09-22 15:18:36.991569', '2015-09-22 15:18:36.991569')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1690, 13550, 'Zest', 'Take time to celebrate being a non-smoker at least twice a week.', '2015-09-22 15:18:37.002372', '2015-09-22 15:18:37.002372')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1691, 13550, 'Appreciation', 'When you feel an urge to smoke, refocus your attention on something beautiful. Take a trip to a museum or take a long walk and notice the beauty in nature.', '2015-09-22 15:18:37.011395', '2015-09-22 15:18:37.011395')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1692, 13550, 'Bravery', 'Text or call a buddy when you have a craving or think about having a cigarette.  Draw on courage to deal with it without giving in. You can do it!', '2015-09-22 15:18:37.027789', '2015-09-22 15:18:37.027789')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1693, 13550, 'Creativity', 'Share the creative ways you are managing your quit attempt with friends and family members.  Perhaps the tools you generate will inspire someone else!', '2015-09-22 15:18:37.046547', '2015-09-22 15:18:37.046547')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1694, 13550, 'Fairness', 'If you are feeling irritable after quitting, realize that it is not anyones fault and that these feelings will pass.', '2015-09-22 15:18:37.056889', '2015-09-22 15:18:37.056889')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1695, 13550, 'Judgment', 'If you feel an urge to pick up a cigarette, play the devils advocate and list all of the reasons quitting is important for your health.', '2015-09-22 15:18:37.075721', '2015-09-22 15:18:37.075721')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1696, 13550, 'Perspective', 'If you are feeling an urge to smoke, reach out to a friend or loved one and tell them all the positive reasons why you have chosen to quit smoking.', '2015-09-22 15:18:37.088788', '2015-09-22 15:18:37.088788')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1697, 13550, 'Learning', 'Try to discover new ways that you feel (physically, mentally, emotionally) now that you are a non-smoker.', '2015-09-22 15:18:37.099605', '2015-09-22 15:18:37.099605')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1698, 13550, 'Humility', 'Dont be afraid to ask others for help during your quit attempt.', '2015-09-22 15:18:37.110161', '2015-09-22 15:18:37.110161')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1699, 13550, 'Intelligence', 'Focus on helping to make someone else feel at ease rather than focusing on your urges to smoke.', '2015-09-22 15:18:37.122549', '2015-09-22 15:18:37.122549')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1700, 13550, 'Prudence', 'When tempted to smoke, tell yourself: Not for the next 5 minutes.  Then stretch out this time period until it becomes hours, then days, then several weeks, etc.', '2015-09-22 15:18:37.134222', '2015-09-22 15:18:37.134222')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1701, 13550, 'Curiosity', 'Make a list of all of the new things you can do now that you are a non-smoker. Remind yourself of these if you get tempted to pick up a cigarette.', '2015-09-22 15:18:37.144269', '2015-09-22 15:18:37.144269')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1703, 13550, 'Leadership', 'See whether you can motivate others interest in quitting smoking with your own process of quitting.  Share tips you find helpful about the PPT program.', '2015-09-22 15:18:37.164832', '2015-09-22 15:18:37.164832')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1704, 13550, 'Love', 'Enjoy an evening with friends or loved ones that is incompatible with smoking (e.g., a smoke-free restaurant; a hike).', '2015-09-22 15:18:37.183802', '2015-09-22 15:18:37.183802')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1705, 13550, 'Forgiveness', 'Forgive others who may smoke around you and make your quit attempt harder.  Take the high road and simply exit the situation.', '2015-09-22 15:18:37.204438', '2015-09-22 15:18:37.204438')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1706, 13550, 'Gratitude', 'Make a list of the things in your life you are grateful for now that you are a non-smoker.', '2015-09-22 15:18:37.217425', '2015-09-22 15:18:37.217425')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1707, 13550, 'Self-Regulation', 'When tempted to smoke, tell yourself: Not for the next 5 minutes.  Then, stretch out this time period until it becomes hours, then days, then weeks, etc.', '2015-09-22 15:18:37.231650', '2015-09-22 15:18:37.231650')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1708, 13551, 'Perseverance', 'You work hard to finish what you start, no matter what.  Remind yourself of this if you feel your commitment to remaining a non-smoker waiver.', '2015-09-22 15:18:37.574096', '2015-09-22 15:18:37.574096')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1709, 13551, 'Teamwork', 'Use the money you save through quitting to help others (e.g., donate half of the money you would have spent on cigarettes to a charity).', '2015-09-22 15:18:37.587583', '2015-09-22 15:18:37.587583')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1710, 13551, 'Hope', 'Believe in yourself and your ability to remain a non-smoker.', '2015-09-22 15:18:37.596439', '2015-09-22 15:18:37.596439')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1711, 13551, 'Humor', 'Look in the mirror and laugh at yourself when you have an urge to smoke.', '2015-09-22 15:18:37.605308', '2015-09-22 15:18:37.605308')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1712, 13551, 'Kindness', 'Do something kind for someone in your life who is helping you to remain a non-smoker. Treat them to a nice meal, buy them flowers, or write them a thoughtful card.', '2015-09-22 15:18:37.617970', '2015-09-22 15:18:37.617970')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1713, 13551, 'Spirituality', 'When tempted to smoke, ask a higher power for help.', '2015-09-22 15:18:37.631113', '2015-09-22 15:18:37.631113')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1714, 13551, 'Zest', 'Instead of smoking, go for a walk or do a physically active chore like gardening.', '2015-09-22 15:18:37.641796', '2015-09-22 15:18:37.641796')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1715, 13551, 'Appreciation', 'Appreciating beauty is something you do naturally. Taking time to appreciate beauty around you each day can lift your mood and take your mind off smoking.', '2015-09-22 15:18:37.652804', '2015-09-22 15:18:37.652804')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1716, 13551, 'Bravery', 'What is the strongest urge to smoke you have ever had?  Tell yourself that if you can get through that, you can get through any urge to smoke.', '2015-09-22 15:18:37.664355', '2015-09-22 15:18:37.664355')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1717, 13551, 'Creativity', 'Try to think of an unconventional way to manage your urges to smoke.', '2015-09-22 15:18:37.673490', '2015-09-22 15:18:37.673490')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1718, 13551, 'Fairness', 'Treat quitting smoking with an open mind.  Learn to see and accept both the challenges and the benefits of quitting.', '2015-09-22 15:18:37.682559', '2015-09-22 15:18:37.682559')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1719, 13551, 'Judgment', 'Use critical thinking to evaluate why its so important to quit smoking.  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:37.691225', '2015-09-22 15:18:37.691225')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1720, 13551, 'Perspective', 'Think about the wisdom of quitting smoking: Why is this a wise decision?  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:37.699930', '2015-09-22 15:18:37.699930')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1721, 13551, 'Learning', 'Share what you learn about the benefits of quitting smoking with someone else. This will allow you to savor what you have learned.', '2015-09-22 15:18:37.708321', '2015-09-22 15:18:37.708321')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1722, 13551, 'Humility', 'Even after you have quit for a few weeks, remind yourself that slips can still happen.', '2015-09-22 15:18:37.717960', '2015-09-22 15:18:37.717960')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1723, 13551, 'Intelligence', 'Be aware of your feelings, both good and bad, while quitting.  Share those feelings with someone you trust rather than trying to change them by smoking.', '2015-09-22 15:18:37.726127', '2015-09-22 15:18:37.726127')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1724, 13551, 'Prudence', 'Before you smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:37.734714', '2015-09-22 15:18:37.734714')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1725, 13551, 'Curiosity', 'Try to discover something new about yourself and your abilities as you become a non-smoker.', '2015-09-22 15:18:37.742956', '2015-09-22 15:18:37.742956')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1726, 13551, 'Honesty', 'Be honest with yourself about your efforts to quit smoking.  Get rid of all emergency or hidden cigarettes.', '2015-09-22 15:18:37.751216', '2015-09-22 15:18:37.751216')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1727, 13551, 'Leadership', 'If you feel an urge to reach for a cigarette, plan a fun group activity to distract yourself. The urge will subside!', '2015-09-22 15:18:37.759848', '2015-09-22 15:18:37.759848')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1728, 13551, 'Love', 'Congratulate and love yourself and your ability to quit smoking each day.', '2015-09-22 15:18:37.767900', '2015-09-22 15:18:37.767900')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1729, 13551, 'Forgiveness', 'Forgive yourself if you slip so that you can move on with a fresh start.  Remember: The most important thing you can do going forward is not light up again!', '2015-09-22 15:18:37.775904', '2015-09-22 15:18:37.775904')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1730, 13551, 'Gratitude', 'Notice and thank the people in your life who are helpful in your quit attempt.', '2015-09-22 15:18:37.785932', '2015-09-22 15:18:37.785932')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1731, 13551, 'Self-Regulation', 'If you get tempted to smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:37.798691', '2015-09-22 15:18:37.798691')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1732, 13552, 'Perseverance', 'Dont forget to take satisfaction in accomplishing your goal to be a non-smoker. Take stock of the amount of time youve been a non-smoker and celebrate.', '2015-09-22 15:18:38.144342', '2015-09-22 15:18:38.144342')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1733, 13552, 'Teamwork', 'You have worked hard to quit smoking. Who can you enlist to be part of your team to remain a non-smoker?', '2015-09-22 15:18:38.159916', '2015-09-22 15:18:38.159916')
