INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1764, 13553, 'Bravery', 'What is the strongest urge to smoke you have ever had?  Tell yourself that if you can get through that, you can get through any urge to smoke.', '2015-09-22 15:18:38.715649', '2015-09-22 15:18:38.715649')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1765, 13553, 'Creativity', 'Try to think of an unconventional way to manage your urges to smoke.', '2015-09-22 15:18:38.724389', '2015-09-22 15:18:38.724389')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1766, 13553, 'Fairness', 'Treat quitting smoking with an open mind.  Learn to see and accept both the challenges and the benefits of quitting.', '2015-09-22 15:18:38.733445', '2015-09-22 15:18:38.733445')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1767, 13553, 'Judgment', 'Use critical thinking to evaluate why its so important to quit smoking.  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:38.741990', '2015-09-22 15:18:38.741990')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1768, 13553, 'Perspective', 'Think about the wisdom of quitting smoking: Why is this a wise decision?  Write these reasons down, and reflect on whether you feel your commitment wavering.', '2015-09-22 15:18:38.750596', '2015-09-22 15:18:38.750596')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1769, 13553, 'Learning', 'Share what you learn about the benefits of quitting smoking with someone else. This will allow you to savor what you have learned.', '2015-09-22 15:18:38.759293', '2015-09-22 15:18:38.759293')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1770, 13553, 'Humility', 'Even after you have quit for a few weeks, remind yourself that slips can still happen.', '2015-09-22 15:18:38.767649', '2015-09-22 15:18:38.767649')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1771, 13553, 'Intelligence', 'Be aware of your feelings, both good and bad, while quitting.  Share those feelings with someone you trust rather than trying to change them by smoking.', '2015-09-22 15:18:38.775836', '2015-09-22 15:18:38.775836')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1772, 13553, 'Prudence', 'Before you smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:38.786014', '2015-09-22 15:18:38.786014')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1773, 13553, 'Curiosity', 'Try to discover something new about yourself and your abilities as you become a non-smoker.', '2015-09-22 15:18:38.794442', '2015-09-22 15:18:38.794442')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1774, 13553, 'Honesty', 'Be honest with yourself about your efforts to quit smoking.  Get rid of all emergency or hidden cigarettes.', '2015-09-22 15:18:38.802839', '2015-09-22 15:18:38.802839')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1775, 13553, 'Leadership', 'If you feel an urge to reach for a cigarette, plan a fun group activity to distract yourself. The urge will subside!', '2015-09-22 15:18:38.811481', '2015-09-22 15:18:38.811481')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1776, 13553, 'Love', 'Congratulate and love yourself and your ability to quit smoking each day.', '2015-09-22 15:18:38.819890', '2015-09-22 15:18:38.819890')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1777, 13553, 'Forgiveness', 'Forgive yourself if you slip so that you can move on with a fresh start.  Remember: The most important thing you can do going forward is not light up again!', '2015-09-22 15:18:38.827998', '2015-09-22 15:18:38.827998')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1778, 13553, 'Gratitude', 'Notice and thank the people in your life who are helpful in your quit attempt.', '2015-09-22 15:18:38.835781', '2015-09-22 15:18:38.835781')
INSERT INTO "message_options" ("id", "message_id", "key", "value", "created_at", "updated_at") VALUES (1779, 13553, 'Self-Regulation', 'If you get tempted to smoke a cigarette, ask yourself: Is this worth disrupting all the progress Ive made?', '2015-09-22 15:18:38.853052', '2015-09-22 15:18:38.853052')
